import React, {Component} from 'react';
import './Login.css'
import {Input,Button, Icon, Form} from 'antd/lib/index';
import FormItem from "antd/lib/form/FormItem";
class Login extends Component{
    constructor(props){
        super(props);
        this.state = {
            email: '',
            password: ''
        }
    }
    // handleInputOnChange = (e) =>{
    //     // this.setState({
