    //     console.log("Change");
    // };
    // handleLoginSubmit = e =>{
    //     e.preventDefault();
    //     console.log("Submit");
    // };

    render() {
        return (
            <div className='Login'>
                <Form className='form-input' layout="inline" onSubmit={this.handleSubmit}>
                    <Form.Item>
                            <Input
                                prefix={<Icon type="email" style={{ color: 'rgba(0,0,0,.25)' }} />}
                                placeholder="Email"
                            />
                    </Form.Item>
                    <Form.Item>
                            <Input
                                prefix={<Icon type="lock" style={{ color: 'rgba(0,0,0,.25)' }} />}
                                type="password"
                                placeholder="Password"
                            />

                    </Form.Item>
                    <Form.Item>
                        <a className="login-form-forgot" href="">
                            Forgot password
                        </a>
                    </Form.Item>
                    <Form.Item>
                        <Button type='primary' htmlType='submit'>
                            Login
                        </Button>
                    </Form.Item>
                </Form>
            </div>
        )
    }
}
export default Login;
